import React, { useState } from 'react'
import { BrowserRouter, Routes,Route } from 'react-router-dom';
import Home from './Home';
import ParkingLot from './ParkingLot';
import { useNavigate } from 'react-router-dom';

function App() {
  let[number,setNumber]=useState();
  let navigate= useNavigate();

  function handleparkinglot(){
     navigate()
  }

  return (
    <BrowserRouter>
      <div style={{display:"flex",justifyContent:"center",alignItems:"center"}}>
        <input type="text" onChange={(e)=>setNumber(e.target.value)} placeholder='please enter number' style={{width:"500px",height:"50px",textAlign:"center",borderRadius:"5px"}}/>
        <button style={{width:"55px",height:"50px",textAlign:"center",borderRadius:"100px",backgroundColor:"green"}} onClick={handleparkinglot}>Submit</button>
      </div>
      <Routes>
        <Route path="/" element={<Home/>} />
        <Route path="/parkinglot"  element={<ParkingLot setNumber={setNumber} number={number}/>} />
      </Routes>
    </BrowserRouter>
  )
}

export default App
